package com.scitrader.finance.examples

import org.json.JSONArray

class DataManager {
    companion object {
        fun getCandles(): List<Candlestick> {
            val result = mutableListOf<Candlestick>()
            val json = JSONArray(response)
            val jsonLength = json.length()

            for (i in 0 until jsonLength) {
                val jsonArray = json[i] as JSONArray

                val length = jsonArray.length()
                if (length < 11) {
                    throw IllegalArgumentException(
                        "Error reading candlestick, 11 parameters expected, "
                                + length + " found"
                    )
                }

                val openTime = jsonArray.getLong(0)
                val open = jsonArray.getDouble(1)
                val high = jsonArray.getDouble(2)
                val low = jsonArray.getDouble(3)
                val close = jsonArray.getDouble(4)
                val volume = jsonArray.getDouble(5)

                val candlestick = Candlestick(openTime, open, high, low, close, volume, "BTCUSDT")

                result.add(candlestick)
            }

            return result
        }

